import React, {useState, useEffect} from 'react';
import { CheckBox, ActivityIndicator, StyleSheet, Text, View, Button, TextInput, Image, Platform} from 'react-native';
import GladImagePicker from './GladImagePicker'
import GladPicker from './GladPicker'
import {Dimensions} from 'react-native';
import HTML from "react-native-render-html";
import { WebView } from 'react-native-webview'


const WINDOW_HEIGHT = Dimensions.get('window').height;
const WINDOW_WIDTH = Dimensions.get('window').width;

export default function CreateLoraForm(){
    const [webHtml, setWebHtml] = useState();

    fetch("http://127.0.0.1:8000/diffusers_api/test_training")
    .then(resp => resp.text())
    .then(text => {
        setWebHtml(text)
    })

    const htmlr='<h1>OH HI MARK!</h1>'
    if (Platform.OS === 'web') 
    {
        return(
            <View>
                <HTML html={htmlr} />
            </View>
        )
    } 
    else if (Platform.OS === 'android') 
    {
        
    } 
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  
    form_container: {
      width: '80%',
      height: 200,
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
  
    form_element: {
      width: '100%',
      maxWidth: WINDOW_HEIGHT-100,
      margin: 4,
    }, 
  
    text_input: {
      height: 40,
      borderWidth: 1,
      borderRadius: 4,
    },
  
    generate_button: {
      width: '100%',
      maxWidth: WINDOW_HEIGHT-100,
      backgroundColor: 'red',
    }, 
  
  });
